import React from 'react'
import './Recent.css'
import Data from './obituaries.json'

const Recent = () => {
    return (
    <div className='recent'>
        <h2>Recent Deaths</h2>
        {Data.map((item, id) => {
            return(
                <div>
                    <p className='title'>{item.title}</p>
                    <p></p>
                    <p></p>
                </div>
            )
        })}
    </div>
  )
}

export default Recent
